                        <sup>₦</sup>
                        <input type="tel" value="100,000" />
                    </div>
                    <div className="roi-dropdown-wrap">
                        <div className="wrap-selection">
                            <select className="roi--select-input">
                                <option value="onetime">Onetime</option>
                                <option value="weekly">Weekly</option>
