                            </select>
                            <div className="roi--select-arrow"><ArrowDown /></div>
                        </div>
                    </div>
                </div>
                <div className="slider-wrap">
                    <div className="slider">
                        <input type="range" min="5000" max="10000000" step="1000" value="100000" />
                    </div>
                </div>
